css:
@-moz-document url-prefix("https://geo-ship.com/") {
body {
    background-color: black
}
home-header {
    background-color: black
}
p {
    color:white
}
.accent {
    background-color: #ffa726;
    color: black;
}
html {
    color: white;
}
.home-header {
    background: black;
}
nav {
    color: white;
    background-color: black;
}
.nav-text-box {
    background-color: black!important;
    color: white!important;
}
.nav-text-box:focus {
    background-color: black!important;
    color: white!important;
}
.default-input {
    background-color: black!important;
    color: white!important;
}
.default-input:focus {
    background: black!important;
}
.card {
    background-color: #000;
}
select {
    background-color: black;
}
.side-nav {
    background-color: black;
}
.side-nav li>a {
    background-color: black;
    color: white;
}
.primary {
    background-color: #a26a17;
    color: white;
}
.geoship-footer nav {
    background-color: #a26a17!important;
}
.modal {
    background-color: black;
}
.modal .modal-footer {
    background-color: gray;
    color: black;
}
.btn-flat {
    color: black;
}
.geo-ship-card {
    background-color:#333333;
}
.link-text {
    color: #86d1ff!important;
}
.item-property-caption {
    color: white;
}
.item-new {
    color: #1be005;
}
.material-icons.md-dark {
    color: rgba(255, 255, 255, 0.54);
}
.dropdown-content {
    background-color: black;
}
.dropdown-content li:hover, .dropdown-content li.active, .dropdown-content li.selected {
    background-color: #424242;
}
.dropdown-content li > a, .dropdown-content li > span {
    color: #ffffff;
}
.blue-text {
    color: #ffffff !important;
}
}
